Based on your description, it seems you didn't provide the decompiled code to convert it into the Solidity contract. Nonetheless, here is a basic example of a Solidity contract:

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract ExampleContract {
    uint256 public data;

    event DataSet(uint256 _data);

    function setData(uint256 _data) public {
        data = _data;
        emit DataSet(_data);
    }
}
```

This contract has a public variable `data` which value can be set by calling the `setData` function. When the `data` is set, an event `DataSet` is emitted.

